SubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"4nhwYkQiQbc\",\"title\":\"Eco-Antifouling Results Q\\u0026A - Failure or Success????\",\"lengthSeconds\":\"1992\",\"keywords\":[\"sailing\",\"sailing around the world\",\"antifouling paint\",\"antifouling a boat\",\"eco-friendly antifouling\",\"إبحار\",\"cruising\",\"yacht\",\"sailboat\",\"sailboat (ship type)\",\"sailor\",\"life on a yacht\",\"Travel Documentary\",\"Travel\",\"Adventure Documentary\",\"adventure\",\"Rough Seas\",\"circumnavigate\",\"ketch\",\"sail\",\"boat\",\"blue water cruising\",\"sailing for beginners\",\"single-handed sailing (film subject)\",\"storm\",\"islands\",\"marine\",\"sv delos\",\"Amel Super Maramu\",\"Seven Seas\",\"delos\",\"ocean\"],\"channelId\":\"UCvLc83k5o11EIF1lEo0VmuQ\",\"isOwnerViewing\":false,\"shortDescription\":\"Eco-friendly antifouling Q\\u0026A with Capt. Brian and Senor Brady.  We sit down and discuss the results of our eco-friendly antifouling experiment.  Brian starts off with a little recap of what we did during our haul out in Grenada, and why we made the decision to try and find a paint that did not rely on traditional antifouling agents.  We show the results of Delos sitting at 3 weeks, 5 weeks, and 7 weeks without moving, and compare those results to boats around us with hard copper, ablative copper, homemade copper-epoxy, and copper coat.  Finally we scrub the bottom clean and start sailing regularly again and show how the effects of water over the hull make a difference in the growth on Delos’s hull.  This was a really interesting video to research and put together, we hope you learned as much as we did!\\n\\nLinks to papers about effects of copper on the environment:\\nhttp:\/\/www.ushydrotech.com\/files\/6714\/1409\/9604\/Impacts_of_Copper_on_Aquatic_Ecosystems_and_human_Health.pdf\\nhttps:\/\/www.chemet.com\/assets\/1\/6\/Copper_and_
